	void LoginHandler::waitForFinishConfig(int sock)
	{
		try
		{
			auto packet = Network::receivePacket(sock, -1);
			if (!packet.empty())
			{
				size_t pos = 0;
				int32_t packetId = Protocol::readVarInt(packet, pos);
				if (packetId == 0x03)
					return;
			}
		}
		catch (...)
		{
		}
	}

	void LoginHandler::sendFinishConfiguration(int sock)
	{
		sendRawPacket(sock, "03");
	}

	void sendChunkBatchFinished(int s, int chunkCount)
	{
		std::vector<uint8_t> body;
		Protocol::writeVarInt(body, 0x0C);
		Protocol::writeVarInt(body, chunkCount);
		sendPacket(s, body, -1);
	}

