	void LoginHandler::sendWorldBorder(int sock)
	{
		std::string packetData = PacketBuilder::buildWorldBorderPacket(0.0, 0.0, 0.0, 59999968.0, 0, 29999984, 5, 15); // TODO: A synchroniser avec le monde (overworld, nether, end ou autre)
		sendRawPacket(sock, packetData);
	}

	void LoginHandler::sendTimeUpdate(int sock)
	{
		int64_t worldAge = 0; // TODO: A synchroniser avec le monde (overworld, nether, end ou autre)
		int64_t dayTime = 0;
		std::string packet = PacketBuilder::buildTimeUpdatePacket(worldAge, dayTime);
		sendRawPacket(sock, packet);
	}

	void LoginHandler::sendSpawnPosition(int sock)
	{
		int32_t x = 0; // TODO: A synchroniser avec le monde (overworld, nether, end ou autre)
		int32_t y = 0;
		int32_t z = 0;

		std::string packet = PacketBuilder::buildSpawnPosition(x, y, z);
		sendRawPacket(sock, packet);
	}

	void LoginHandler::sendHealth(int sock)
	{
		std::string packet;
		auto client = getPlayer(sock);

		packet += PacketBuilder::varIntToHex(0x5D);
		packet += PacketBuilder::floatToHex(client->getHealth());
		packet += PacketBuilder::varIntToHex(client->getFood());
		packet += PacketBuilder::floatToHex(client->getSaturation());

		sendRawPacket(sock, packet);
	}

	int LoginHandler::sendChunksAroundPlayer(int sock, int playerChunkX, int playerChunkZ, int viewDistance)
	{
		int numberChunk = 0;

		for (int dx = -viewDistance; dx <= viewDistance; ++dx)
		{
			for (int dz = -viewDistance; dz <= viewDistance; ++dz)
			{
				int chunkX = playerChunkX + dx;
				int chunkZ = playerChunkZ + dz;

				auto data = makeChunkPacket(chunkX, chunkZ);
				sendRawPacketBin(sock, data);
				numberChunk++;
			}
		}
		return numberChunk;
	}

	void LoginHandler::sendChunkData(int sock)
	{
		auto player = getPlayer(sock);

		int chunkX = static_cast<int>(std::floor(player->getPosition().x)) >> 4;
		int chunkZ = static_cast<int>(std::floor(player->getPosition().z)) >> 4;

		auto data = makeChunkPacket(0, 0);
		sendRawPacket(sock, "0d");
		int numberChunk = sendChunksAroundPlayer(sock, chunkX, chunkZ, 5);
		sendChunkBatchFinished(sock, numberChunk);
	}

	std::shared_ptr<Client> LoginHandler::getPlayer(int sock) const
	{
		auto it = m_players.find(sock);
		return (it != m_players.end()) ? it->second : nullptr;
	}

	void LoginHandler::removePlayer(int sock)
	{
		m_players.erase(sock);
	}
